}


// left info
class LeftInformations extends Component {

    render() {
      return (
          <div className="leftContents flt_left cf">
            <article>
              <div className="cf">
                <div className="flt_left">
                  <p className="ractBox">
                    <a href="/" className="Acc">
                      <FontAwesomeIcon icon={faUser}/>
