                </p>
                <p className="viewMore flt_left"><a href="/">View More</a></p>
              </div>
            </article>

            <article>
              <p className="explnationWrap">
                <span className="explnation">A course program that organizes all the cleanser programs of Mercy Juice, which are specialized in excellent cleansing effects and balanced nutritional supply, in a step-by-step manner to achieve a more balanced and effective process.</span>
              </p>
              <h3>TOTAL CLEANSER 3DAYS</h3>
            </article>
          </div>
      )
    }


  }




